import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import AboutUs from "./components/AboutUs/AboutUs";
import AssociatesHome from "./components/OurAssociates/AssociatesHome";
import Home from "./Home";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/AboutUs">
          <AboutUs />
        </Route>
        <Route path = "/AssociatesApp">
          <AssociatesApp />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
